INSERT INTO `event_details` (`EventID`, `EventName`, `EventDate`, `EventTime`, `EventCategory`, `EventDescription`, `EventTicketPrice`, `EventTicketTotal`, `EventTicketSold`, `VenueID`, `UserID`) VALUES
(1, 'Hari Merdeka', '2019-08-31', '08:00:00', 'Celebration', 'Hari Merdeka (Malaysian for \'Independence Day\'), also known as Hari Kebangsaan (National day), refers to the day when the Federation of Malaya\'s independence from the British Empire was officially declared. At exactly 09:30 on 31 August 1957, the declaration was read by the first Chief Minister of Malaya, Tunku Abdul Rahman at the Merdeka Stadium in the presence of thousands of people including Malay Rulers, members of the federal government, and foreign dignitaries.\r\n\r\nTo commemorate the event, Hari Merdeka was declared a national holiday in Malaysia and observed annually on 31 August. The day should not be confused with Hari Malaysia (\'Malaysia Day\') that commemorates the formation of Malaysia on 16 September 1963, when North Borneo, Sarawak, and Singapore federated with the existing states of the Federation of Malaya.', 5, 50000, 2, 2, 'AUTAR002'),
(2, 'Movie Night: Aladdin 2019', '2019-08-18', '22:00:00', 'Movie, Gathering', 'Aladdin is a lovable street urchin who meets Princess Jasmine, the beautiful daughter of the sultan of Agrabah. While visiting her exotic palace, Aladdin stumbles upon a magic oil lamp that unleashes a powerful, wisecracking, larger-than-life genie. As Aladdin and the genie start to become friends, they must soon embark on a dangerous mission to stop the evil sorcerer Jafar from overthrowing young Jasmine\'s kingdom.', 16, 300, 2, 3, 'AUTAR001'),
(3, '11TH MBA INTERNATIONAL BADMINTON CHAMPIONSHIP 2019', '2019-07-26', '08:00:00', 'Sports', 'Players from 16 countries enjoy a game of badminton at the recently concluded 10th Michael’s Badminton Academy (MBA) International Championships held in Port Dickson, Negeri Sembilan recently. \r\n\r\nA total of 700 players from Canada, Denmark, Bangladesh, Japan, Iraq, India, Indonesia, Hong Kong, Macau, Maldives, Sri Lanka, Singapore, Philippines, Vietnam and Thailand competed in junior, senior and veteran age group categories. ', 50, 1000, 1, 5, 'AUTAR001'),
(4, 'MEGA CAREERS & STUDY FAIR (MCASF 12th edition) ', '2019-08-24', '10:00:00', 'Fair', 'Mega Careers & Study Fair (MCASF) is a 3-in-1 career and postgraduate fair that brings together the best companies and universities, all under one roof.', 12, 50000, 1, 1, 'AUTAR002'),
(5, 'Electronic Dance Music (EDM) Festival', '2019-12-30', '21:00:00', 'Concert, Entertainment', 'â€œItâ€™s hot, itâ€™s wet, itâ€™s wild! Grab your water guns, dress for battle and get soaked in the water splashing madnessâ€¦â€\r\n\r\nAn amalgamation of dance music with a traditional Thai watering festival: youâ€™re basically paying to get drenched in water whilst raving to the worldâ€™s top DJs - not bad, right? Last yearâ€™s festival welcomed DJ Snake, Oliver Heldens, and Krewalla.\r\n\r\n***For more information, please visit: S20Songkranâ€***', 150, 15000, 4, 6, 'AUTAR001'),
(6, 'MoonDance @ SkySymphony', '2019-08-10', '00:30:00', 'Festival', '3, 2, 1â€¦ and blast off! To the moon goes Gentingâ€™s Highland Heroes! Joined by adorable Moon Bunnies, be immersed in an epic outer space dance party, where stunning visuals are paired with catchy tunes and dynamic winch balls for an upbeat, show-stopping performance. \r\n\r\nShow runs every half an hour.', 0, 10000, 3, 7, 'AUTAR005'),
(7, 'How to Train Your Dragon: The Hidden World', '2019-09-19', '21:30:00', 'Movie', 'From DreamWorks Animation comes a surprising tale about growing up, finding the courage to face the unknownâ€¦and how nothing can ever train you to let go. What began as an unlikely friendship between an adolescent Viking and a fearsome Night Fury dragon has become an epic adventure spanning their lives. Welcome to the most astonishing chapter of one of the most beloved animated franchises in film history: How to Train Your Dragon: The Hidden World. Now chief and ruler of Berk alongside Astrid, Hiccup has created a gloriously chaotic dragon utopia. When the sudden appearance of female Light Fury coincides with the darkest threat their village has ever faced, Hiccup and Toothless must leave the only home theyâ€™ve known and journey to a hidden world thought only to exist in myth. As their true destines are revealed, dragon and rider will fight together -- to the very ends of the Earth -- to protect everything theyâ€™ve grown to treasure. For How to Train Your Dragon: The Hidden World, series director Dean DeBlois returns alongside the all-star cast. The film is produced by Brad Lewis (Ratatouille, ANTZ) and Bonnie Arnold (Toy Story, How to Train Your Dragon,How to Train Your Dragon 2).', 16, 200, 3, 3, 'AUTAR001');

